import React from "react";
import {useState,useEffect} from "react";

function App() {
  const [todoList, setTodoList] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5000/')
    .then((res)=>res.json())
    .then((data)=>setTodoList(data));
  }, [])

  return (
    <div className="App">
      <h1>TODO LIST</h1>
      {todoList.map((todo)=>(
        <div>
          <div>{todo.name}</div>

        </div>
      ))}
    </div>
  );
}

export default App;
